Let the number of red 4-door cars be $x$.  Since $\frac13$ of the cars are red, there are $\frac13\cdot 30 = 10$ red cars, so there are $10 -x$ red 2-door cars.  There are $(50\%)\cdot 30 = (0.5)(30) = 15$ cars that are 4-door cars, so $15-x$ of the 4-door cars are not red.  We then have the following Venn diagram:

[asy]
unitsize(0.05cm);
label("Red cars", (2,74));
label("4-door cars", (80,74));
draw(Circle((30,45), 22));
draw(Circle((58, 45), 22));
label("White 2-door cars: 8",(44,10));
label("$x$", (44, 45));
label(scale(0.8)*"$10-x$",(28,58));
label(scale(0.8)*"$15-x$",(63,58));
[/asy]

Adding all four categories, we have  \[(10-x)+x+(15-x) + 8 = 30.\]Simplifying gives $33-x = 30$, so $x = \boxed{3}$.

In isosceles right triangle $\triangle ABC$ below, $\overline{AD}$ is the altitude to the hypotenuse.

[asy]
import olympiad;
unitsize(0.8inch);
pair A,B,C,D;
A = (0,1);
B= (1,0);
C = -B;
D = (0,0);
draw(A--B--C--A,linewidth(1));
draw(A--D,linewidth(0.8));
draw(rightanglemark(C,A,B,s=5));
draw(rightanglemark(C,D,A,s=5));
label("$A$",A,N);
label("$B$",B,S);
label("$C$",C,S);
label("$D$",D,S);
[/asy]

Because $\triangle ABC$ is an isosceles right triangle, $\angle ABC = 45^\circ$.  Since $\angle ADB = 90^\circ$, we know that $\angle DAB = 45^\circ$, so $\triangle ABD$ is also a 45-45-90 triangle.  Similarly, $\triangle ACD$ is a 45-45-90 triangle.  Therefore, $DB=DC = DA = 4\sqrt{2}$, so $BC = BD+DC = 8\sqrt{2}$, and  \[[ABC] = \frac{(AD)(BC)}{2} = \frac{(4\sqrt{2})(8\sqrt{2})}{2} = \boxed{32}.\]

